import { Link } from "react-router-dom";
import Login from "./Login";
import { useState } from "react";

const Signup = () => {
    const [formVal, setFormVal] = useState("");

    const handleChange = () => {
        setFormVal(e => e.target.value)
    }
    return (
        <main>
            <div className="background"></div>
            <h3>Sign Up</h3>
            <form>
                <label>
                    Email
                    <input for="username" type = "text" placeholder = "Email" id = "username" onChange={handleChange}/>
                </label>
                <label>
                    Password
                    <input for = "password" type = "text" placeholder="Password" id = "password" onChange={handleChange} />
                </label>
                <button>Log In</button>
                <div class="social">
                    <div class="go"><i class="fab fa-google"></i>  Google</div>
                </div>
            </form>
            <Link to = "/login" className="login-link">Already have a account? Click here to Login</Link>

        </main>
    )
}

export default Signup;
